import React, { Component } from 'react';
import './App.css';
import BaseSalaryInput from './components/BaseSalaryInput';

export default class App extends Component {
  componentDidMount() {
    this.setState({
        baseSalary: 0,
        discountINSS: 0,
        baseIRPF: 0,
        discountIRPF: 0,
    });
}

  render() {
    return (
      <div className="App">
        <BaseSalaryInput />
      </div>
    );
  }

}
